import React, { useContext } from "react";
import "./Home.css";
import Header from "../Header/Header";
import MangasList from "../MangaList/MangasList";
import { MangaContext } from "../MangaCont";

const Home = () => {
  const [manga, setManga] = useContext(MangaContext);
  return (
    <div>
      <Header></Header>
      {manga.map((M) => (
        <MangasList m={M} />
      ))}
    </div>
  );
};

export default Home;
